 * @param {Object} propsMap 
 * @param {string[]} attrs 
 */
export default function createStyledComponent({ displayName, className, props: propsMap, attrs, invalidProps }) {
  class StyledComponent extends PureComponent {
    render() {
      const { props } = this;
      const classNames = classnames(className, Object.keys(props).map(key => propsMap[key]));
      return createElement('div', Object.assign(
        {},
        omitBy(props, (value, key) => invalidProps[key]),
        {
          className: classNames,
          style: Object.assign(
            {},
            props.style,
            mapValues(attrs, ({ name, type, defaultValue, className }) => {
