    const value = object[key];
    if (!filter(value, key)) {
      newObj[key] = value; 
    }
  }
  return newObj;
};

const mapValues = (object, transformer) => {
  const newObj = {};
  for (let key of Object.keys(object)) {
    newObj[key] = transformer(object[key]);
  }
  return newObj;
};

